import { Link } from "react-router-dom";

export const Books = () => {
  const BOOKS = [
    { id: "p1", title: "Livre 1" },
    { id: "p2", title: "Livre 2" },
    { id: "p3", title: "Livre 3" },
  ];
  return (
    <>
      <h1>Mes livres</h1>
      <ul>
        {BOOKS.map((book) => (
          <li key={book.id}>
            <Link>{book.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};
